      <!-- <h1 class="font-medium mt-10 text-xl ml-3">
        You can activate the Virtual NUBAN Account, the Direct Debit or both to
        manage your payments.
      </h1> -->
      <!-- <paymentTabs class="mt-8" /> -->
      <!-- <hr class="mt-6 horizontal1" /> -->
      <p class="mt-6 text-lg font-thin ml-3">
        The direct debit payment service is a secure payment option provided by
        Paystack and the Nigeria Inter-Bank Settlement Service (NIBSS) through
        her automated payment service (NAPS).
      </p>
      <p class="mt-8 text-lg font-thin ml-3">
        It facilitates third-party payments from your profiled accounts to
        third-party beneficiaries (for Example, salary payments to employees,
        supplier payments, etc.)
      </p>
      <p class="mt-8 text-lg font-thin ml-3">
        To activate your account on Paystack, you must profile on NAPS. Once you
        set up, you can securely initiate and conclude third-party payments
        directly from Cloudenly.
      </p>
    </div>

